window.bookSummaryJSON = "<p><b>A powerful witch. A forgotten memory. A dangerous prophecy.</b></p> <p>Alice Skye has come a long way since she was an inexperienced witch at the Supernatural Intelligence Bureau. Having fought monsters, ruthless assassins and a savage wolf shifter or two, she’s sure there’s no crisis too catastrophic for her to overcome.</p> <p>But nothing could prepare her for what the fates have planned.</p> <p>With vampires turning up drained of blood, whispers of an uprising and portals opening randomly across the city, Alice’s carefully constructed control is put to the test.</p> <p>Her legendary power is growing once again, her inner fire twisting in turmoil, wanting to break free and destroy everything in its path.</p> <p>Alice is on the verge of becoming War, a destiny she has struggled against her whole life. But there are those who would use the prophecy to their advantage, to tear the veil between the realms and shatter the delicate balance that has been there since the beginning of time.</p> <p>Will the veil fall and release the horrors that are imprisoned in The Nether below?</p> <p>Or will Alice rewrite her own destiny?</p> <p>The hunt has begun.</p> <p><b><i>Veil's Fall</i></b><b> is the sixth and final instalment in this nail-biting, action packed Dark Urban Fantasy series by Taylor Aston White. Follow Alice as she battles her Daemons, and unveils dark secrets in a modern world of magic.</b></p> <p><i>Disclaimer: This novel is written in British English including spelling and grammar.</i></p>"; 
